package com.tenXen.core.domain;public class UserFriend extends BaseDomain {    private static final long serialVersionUID = 1L;    /**     * 用户ID     **/    private Integer userId;    /**     * 好友     **/    private Integer friendId;    /**     * 关系     **/    private Integer relation;    public Integer getUserId() {        return this.userId;    }    public void setUserId(Integer userId) {        this.userId = userId;    }    public Integer getFriendId() {        return this.friendId;    }    public void setFriendId(Integer friendId) {        this.friendId = friendId;    }    public Integer getRelation() {        return this.relation;    }    public void setRelation(Integer relation) {        this.relation = relation;    }}